import { render } from "react-dom";
import React from "react";
import Carousel from "react-image-carousel";
import "./style.css";
let images = [
  "https://picsum.photos/200/300",
  "https://picsum.photos/200/300",
  "https://picsum.photos/200/300",
  "https://picsum.photos/200/300",
  "https://picsum.photos/200/300",
]
render(<div className="my-carousel">
            <Carousel images={images} 
                        thumb={true}
                        loop={true}
                        autoplay={3000}/>
        </div>, document.getElementById("theCarousel"))
function FictionCarousel(props){
    return(
      <div id="theCarousel">
    </div>
    )
}

export default FictionCarousel;
